import React from "react";
import { ButtonContainer } from "../components/Button";
import { Link } from "react-router-dom";

export default function Home() {
  return (
    <div className="col-5">ffffff
      <Link to="/Products">
        <ButtonContainer>Our Products</ButtonContainer>
      </Link>
    </div>
  );
}
